import React from 'react';
import '../../App.css';

function Game() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>TRIVIA</h1>
        <img
          alt="Profile"
          data-testid="header-profile-picture"
          src="/"
        />
      </header>
    </div>
  );
}

export default Game;
